            <span>Welcom to GameREC!</span>
            <div className="Category">
                <label>Select Your Favorite Genres</label>
                <div>
                    <label>
                        <input type="checkbox"
                            defaultChecked={checked}
                            onChange={() => setChecked(!checked)}
                        />
                        Action
